    public function benchPregSplit(): void {
        $numberOfWords = count(preg_split("/\s+/", $this->text));
    }

    public function benchPregSplitExtended(): void {
        $numberOfWords = count(preg_split('/\s+|(?<!^)(?=\p{L}\p{M}*\p{Z})|(?<=\p{Z})/u', $this->text, -1, PREG_SPLIT_NO_EMPTY));
    }

